import React from 'react';
import {BrowserRouter as Router} from 'react-router-dom';
import Navigation from './components/Navigation';
import LoggedRouter from "./components/LoggedRouter";
import UnLoggedRouter from "./components/UnLoggedRouter";
import axios from 'axios';
import {connect} from 'react-redux';

const accessToken = localStorage.getItem('accessToken') || '';

// Setting baseURL
axios.defaults.baseURL = 'http://localhost:8080';

const App = ({isLogged}) => {
    return (
        <Router>
            <Navigation accessToken={accessToken}/>
            {isLogged && <LoggedRouter accessToken={accessToken}/>}
            {!isLogged && <UnLoggedRouter/>}
        </Router>
    );
};

const mapStateToProps = (state) => {
    return {
        isLogged: state.isLogged,
    };
};

export default connect(mapStateToProps)(App);
